import React from 'react';
import { Box, Container, Button, Grid, Paper } from '@mui/material';
import { makeStyles } from '@material-ui/core';

import Hero from '../../Hero/Hero';
import Footer from '../../Footer/Footer';

import N from './Assets/N.png';

const useStyles = makeStyles((theme) => ({
  textContent: {
    alignSelf: 'center',
  },
  image: {
    textAlign: 'right',
    alignSelf: 'center',
  },
  row: {
    marginTop: theme.spacing(2),
  },
}));

const Education = (props) => {
  const classes = useStyles();

  const heading = 'Education';
  const caption = 'This is my Education';
  const image =
    'https://images.pexels.com/photos/267885/pexels-photo-267885.jpeg?cs=srgb&dl=pexels-pixabay-267885.jpg&fm=jpg';
  const btnLeft = 'About Me';
  const btnRight = 'Projects';
  return (
    <Box>
      <Hero
        heading={heading}
        caption={caption}
        image={image}
        btnLeft={btnLeft}
        btnRight={btnRight}
      />

      <Container maxWidth="lg">
        <Paper>
          <Container maxWidth="md">
            <Grid container xs={12} className={classes.row}>
              <Grid item xs={9} className={classes.textContent}>
                <Box>
                  <h3>University of Nevada Reno</h3>
                  <Box>Bachelors of Science: Mechanical Engineering</Box>
                </Box>
              </Grid>
              <Grid item xs={3} className={classes.image}>
                <Box>
                  <img src={N} alt="N"></img>
                </Box>
              </Grid>
            </Grid>
          </Container>
        </Paper>
      </Container>

      <Footer />
    </Box>
  );
};

export default Education;
